// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './components/login';
import Addproducts from './components/addproducts';
import Adminpage from './components/adminpage';
import Userlist from './components/userlist';
import Editproducts from './components/Editproducts';
import Editpicture from './components/Editpicture';
import Trangchu from './components/Trangchu';
import ProductDetail from './components/ProductDetail';
import Cart from './components/cart';
import Payment from './components/payment';
import Order from './components/order';
import Orderdetail from './components/orderdetail';
import AllProducts from './components/AllProducts';
import Natural from './components/Natural';
import Artificial from './components/Artificial'
import OrderManagement from './components/ordermanagement';
import FindProducts from './components/FindProducts';
import DangKy from './components/DangKy';
const App = () => {

  return (
    <Router>
      <Routes>
        <Route path='/login' element={<Login />} /> Đăng nhập
        <Route path='/' element={<Trangchu />} /> Trang chủ
        <Route path="/product-detail/:id" element={<ProductDetail />} /> Chi tiết sản phẩm
        <Route path='/giohang/:id' element={<Cart />} /> Giỏ hàng
        <Route path='/payment/:id' element={<Payment />} /> Thanh toán
        <Route path='/dondh/:id' element={<Order />} /> xem hóa đơn
        <Route path='/orderdetail/:id/:ma_van_don' element={<Orderdetail />} /> Chi tiết hóa đơn
        <Route path='/AllProducts' element={<AllProducts />} /> Tất cả sản phẩm
        <Route path='/Natural' element={<Natural />} /> Trang Kim cương tự nhiên
        <Route path='/Artificial' element={<Artificial />} /> Trang kim cương nhân tạo
        <Route path='/FindProducts/:id' element={<FindProducts />} /> Tìm kiếm sản phẩm
        <Route path='/DangKy' element={<DangKy />} /> Đăng ký

        <Route path='/admin' element={<Adminpage />} /> Quản lý sản phẩm
        <Route path='/addproducts' element={<Addproducts />} /> Thêm sản phẩm
        <Route path='/user' element={<Userlist />} /> Quản lý người dùng
        <Route path='/editproducts/:id' element={<Editproducts />} /> Sửa sản phẩm
        <Route path='/editpicture/:id' element={<Editpicture />} /> 
        <Route path='/OrderManagement' element={<OrderManagement />} /> Quản lý đơn đặt hàng
      </Routes>
    </Router>

  );
};

export default App;
